import * as React from 'react';
import ResponsiveAppBar from './AppBar';


export default class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      imageLoaded: false,
      currentPage: 0
    };
  }

  render(){
    return(
      <AppBar position="relative">
        <Toolbar>
          <CameraIcon sx={{ mr: 2 }} />
          <Typography variant="h6" color="inherit" noWrap>
            Album layout
          </Typography>
        </Toolbar>
      </AppBar>
    );
  }
}
